function bindError(obj) {
    var shijian = obj.shijian.split('|');
    var go = obj.other.zhans['1'],
        gostr = '';
    var back = obj.other.zhans['2'],
        backstr = '';
    var str = '';

    for (var i = 0; i < go.length; i++) {
        gostr += '<li><span class="num">' + (i + 1) + '</span><input type="text" name="up[]" value="' + go[i].zhan + '" /><p><span class="write"></span><span class="delete_li"></span></p></li>'
    }
    for (var i = 0; i < back.length; i++) {
        backstr += '<li><span class="num">' + (i + 1) + '</span><input type="text" name="down[]" value="' + back[i].zhan + '" /><p><span class="write"></span><span class="delete_li"></span></p></li>'
    }
    str += "<div class='big_error'>"
    str += "<div class='end_write'>"
    str += "<dl>"
    str += "<dt>是否退出编辑?</dt>"
    str += "<dd class='no'>否</dd>"
    str += "<dd class='yes'>是</dd>"
    str += "</dl>"
    str += "</div>"
    str += "<div class='form_dialog' style='display:none'>"
    str += "<dl>"
    str += "<dt>确定提交?</dt>"
    str += "<dd class='no'>否</dd>"
    str += "<dd class='yes'>是</dd>"
    str += "</dl>"
    str += "</div>"
    str += '<p class="c_error">' + obj.busw + '<span>全屏</span><em>关闭</em></p>'
    str += '<ul class="tab_error">'
    str += '<li class="active">编辑去程线路</li>'
    str += '<li class="mid_error">编辑回程线路</li>'
    str += '<li>编辑线路信息</li>'
    str += '</ul>'
    str += '<div class="tab_big">'
    str += '<ul class="srue_li">'
    str += '<li>删除站点</li>'
    str += "<li class='srue_delete'></li>"
    str += '<li class="last"><em>确认</em><em>取消</em></li>'
    str += '</ul>'
    str += '<form action="" method="post" id="error_form" name="error_form" >'
    str += "<input type='text' name='busw' value='" + obj.busw + "' hidden/>"
    str += '<input type="text" name="line_id" value="' + obj.id + '" hidden/>'

    str += '<div class="error_go each">'
    str += '<p class="add"><input class="add_name" type="text" placeholder="请输入新增站点的名称"/><input class="add_srue" type="button" value="新增站点"></p>'
    str += '<div class="under">'
    str += '<ul class="station">' + gostr + '</ul>'
    str += '</div>'
    str += '</div>'
    str += '<div class="error_back each" style="display:none">'
    str += '<p class="add"><input class="add_name" type="text" placeholder="请输入新增站点的名称"/><input class="add_srue" type="button" value="新增站点"></p>'
    str += '<div class="under">'
    str += '<ul class="station">' + backstr + '</ul>'
    str += '</div>'
    str += '</div>'
    str += '<div class="information each" style="display:none">'
    str += '<label><span>票价</span><input type="text" name="piao" value="' + obj.piao + '"/></label>'
    str += '<label><span>始发站信息</span><input type="text" name="s_time" value="' + shijian[0] + '"/></label>'
    str += '<label><span>终点站信息</span><input type="text" name="e_time" value="' + shijian[1] + '"/></label>'
    str += '<label><span>线路类型</span><input type="text" name="kind" value="' + obj.kind + '"/></label>'
    str += '<label><span>所属公交公司</span><input type="text" name="gjgs" value="' + obj.gjgs + '"/></label>'
    str += '<label><span>备注</span><textarea name="note" rows="" cols="">' + obj.note + '</textarea></label>'
    str += '<label><span>参考资料</span><textarea name="cankao" rows="" cols=""></textarea></label>'
    str += '<label><span>纠错原因</span><textarea name="reason" rows="" cols="">纠错原因</textarea></label>'
    str += '</div>'
    str += '<input class="err_btn" type="button" value="提交"/>'
    str += '</form>'
    str += '</div>'
    str += '</div>'
    return str;
}
